import React, { Component } from 'react'
import styled from 'styled-components'

const TelaCarrinho = styled.div`
background-color: orange;
`

export default class Cart extends Component {
  render() {
    return (
      <TelaCarrinho>Cart</TelaCarrinho>
    )
  }
}
